  description:
    '<span style="font-size:18px;"><strong>Features:</strong></span>\n<ul>\n\t<li><span style="font-size:16px;">M6 Pro(21) is equipped with 3.5mm single-ended, 2.5mm balanced and 4.4mm balanced audio output interfaces.</span></li>\n\t<li><span style="font-size:16px;">Fully balanced amp circuit, new OP+BUF audio architecture.</span></li>\n\t<li><span style="font-size:16px;">Equipped with two ES9068AS flagship DAC chips that support MQA hard-decoding. Equipped with an ultra-low-noise LDO linear stabilized power supply, the vocal density is large and the sense of transparency is full, and the characteristics of fresh and natural sound are brought into full play.</span></li>\n\t<li><span style="font-size:16px;">The low-pass filter is newly upgraded to the OPA2211 dual-channel operational amplifier of TI. It uses a completely independent circuit system to minimize crosstalk and achieve ultra-low noise, low power consumption, and high bandwidth and other audio performance.</span></li>\n\t<li><span style="font-size:16px;">The operational amplifier adopts the ADA4610-2 dual-channel, JFET operational amplifier of American ADI Company. Features such as low noise, low distortion, high output current, and excellent speed make it a good choice for audio applications.</span></li>\n\t<li><span style="font-size:16px;">The driving amplifier circuit uses the BUF634A high-speed buffer from TI, which can increase the output current of M6 Pro (21) and provide capacitive load driving capability.</span></li>\n\t<li><span style="font-size:16px;">Self-developed FPGA coding technology: Self-adaptive clock sampling algorithm with independent intellectual property rights can provide more accurate clock signals, high-standard sampling rate PCM data output and DSD decoding.</span></li>\n\t<li><span style="font-size:16px;">Different from the soft solution MQA which needs to consume more CPU resources and memory, the DAC of M6 Pro (21) supports native hard solution MQA, and with the CPU, it can expand 16 times the full-channel digital signals from local, streaming media, USB Audio, etc.! Three Kind of filtering new dynamic EQ.</span></li>\n</ul>\n<br>\n<strong><span style="font-size:18px;">Specifications:</span></strong><br>\n<br>\n<span style="font-size:16px;">1. Output power<br>\nLow gain: 0.79V@32 Ohm (20mW)<br>\nMedium gain: 1.38V@32 Ohm (60mW)<br>\nHigh gain: 2.76V@32 Ohm (240mW)<br>\n2. Frequency response: 20Hz-40KHz (0.5dB)<br>\n3. THD+N: 0.0005%<br>\n4. Separation: 75dB@32 Ohm<br>\n5. Dynamic range: 125dB<br>\n6. Signal to noise ratio: 124dB<br>\n7. Noise floor: &gt;113dB(1.5uV)<br>\n8. Output impedance: 0.3 Ohm<br>\n<br>\nBAL output:<br>\n1. Output power<br>\nLow gain: 1.38V@32 Ohm (60mW)<br>\nMedium gain: 2.76@32 Ohm (240mW)<br>\nHigh gain: 4.93V@32 Ohm (760mW)<br>\n2. Frequency response: 20Hz-40KHz (-0.5dB)<br>\n3. THD+N: 0.0005%<br>\n4. Separation: 110dB@32 Ohm<br>\n5. Dynamic range: 124dB<br>\n6. Signal to noise ratio: 126dB<br>\n7. Noise floor: &gt;112dB(1.9uV)<br>\n8. Output impedance: 0.6 Ohm</span>',
